import React from "react";
import styled from "styled-components";

const Contacts = () => {

    return (
        <ContactsContainer>
            <Iphone>
                <StatusBar>
                    <span className="primaryButtonText">9:41</span>
                    <RightSide>
                        <img src="/iPhoneImage/mobile-signal.svg" alt="mobile-signal"></img>
                        <img src="/iPhoneImage/Wifi.svg" alt="wi-fi"></img>
                        <img src="/iPhoneImage/Battery.svg" alt="battery"></img>
                    </RightSide>
                </StatusBar>
            </Iphone>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 70%;
    height: 100vh;
    margin: 90px auto;
    align-items: center;
    display: flexbox;
`

const Iphone = styled.div`
    width: 437px;
    height: 882px;
    margin: 0px auto;
    background-image: url(/iPhoneImage/iPhoneImage.svg);
`

const StatusBar = styled.div`
    width: 85%;
    height: 47px;
    margin: 1.2em auto;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const LeftSide = styled.span`
    width: 
`

const RightSide = styled.span`
    width: 78px;
    display: flex;
    padding-right: 1em;
    flex-direction: row;
    align-items: center;
    justify-content:  space-between;
`

export default Contacts;
